import React from 'react';
import "./styles/Inicio.css";
import { useNavigate } from 'react-router-dom';

const Inicio = () => {
  const navigate = useNavigate();

  const handleNavigation = (opcion) => {
    if (opcion === 'formulario') {
      navigate('/formulario');
    } else if (opcion === 'feedback') {
      navigate('/feedback');
    }
  };

  return (
    <div>
      <h1>Inicio de Sesión</h1>
      <p>¿Eres un captador o un comercial?</p>
      <button onClick={() => handleNavigation('formulario')}>Captadores</button>
      <button onClick={() => handleNavigation('feedback')}>Comerciales</button>
    </div>
  );
};

export default Inicio;
